import {AiOutlineLinkedin} from "react-icons/ai"
import {AiOutlineInstagram} from "react-icons/ai"
import {FiGithub} from "react-icons/fi"

const Footer = () => {
    return (
        <div id="footer">
            <FiGithub/>
            <AiOutlineInstagram/>
            <AiOutlineLinkedin/>
        </div>
    )
}

export default Footer
